$_MODULE['<{mbeshipping}prestashop>welcome_06acb34650df4917a32a707f41eb0994'] = 'Spedizioni e logistica digitalizzate con MBE';
$_MODULE['<{mbeshipping}prestashop>welcome_bd279c91483c0fd991bf0dd24082c847'] = 'Dai un nuovo impulso al tuo e-commerce: con le soluzioni MBE per digitalizzare spedizioni e logistica, pensate per aziende, imprenditori ma anche artigiani che cercano un partner affidabile che possa supportarli portando con successo il loro business online con soluzioni complete e flessibili, anche su grandi marketplace come Amazon ed e-Bay e sono compatibili con Magento CE, PrestaShop, Shopify, WooCommerce oltre alla possibilità di personalizzarle tramite API.';
$_MODULE['<{mbeshipping}prestashop>welcome_02d4482d332e1aef3437cd61c9bcc624'] = 'Contattaci';
$_MODULE['<{mbeshipping}prestashop>welcome_ee3ae8f2b909a448403a77ffbb3cb259'] = 'Inizia la configurazione';
$_MODULE['<{mbeshipping}prestashop>welcome_0d7545e6e62aa27411c09e133edba866'] = 'Connettendo il tuo canale e-commerce con la piattaforma MBE, puoi automatizzare la gestione delle spedizioni e facilitare il processo di vendita. ';
$_MODULE['<{mbeshipping}prestashop>welcome_461b35b457d9b9ba7ee9b502c377cc30'] = 'Soluzioni Digitali di MBE';
$_MODULE['<{mbeshipping}prestashop>welcome_1bcd51908f4de69964082ee6a92fa697'] = 'I servizi digitali chiavi in mano che aiutano il tuo brand a decollare. Raggiungi i tuoi clienti online con soluzioni digitali e strumenti di web marketing che ti danno maggiori possibilità di raggiungere il tuo pubblico costruendo una presenza online efficace per la tua azienda ed essere dove sono i tuoi clienti. MBE ti offre soluzioni efficaci per far crescere i tuoi canali digitali. Metti in mostra il tuo marchio, negozio e-commerce o migliora il tuo sito web attuale per renderlo più visibile sui motori di ricerca.';
$_MODULE['<{mbeshipping}prestashop>welcome_47e149951cc16a06badb305ea12b2dd5'] = 'MBE Packing	';
$_MODULE['<{mbeshipping}prestashop>welcome_6efcae05527f34189a6799f27c0ae9bd'] = 'Il servizio di imballaggio che dà una marcia in più alla tua attività. I tuoi clienti meritano un\'esperienza unica: sorprendili durante l\'unboxing con le soluzioni di imballaggio su misura per i tuoi prodotti. Una soluzione altamente personalizzata che valorizza il tuo brand e aggiunge un tocco di stile in base alle tue specifiche esigenze. Oltre ad ottimizzare tempo e risorse puoi ridurre l\'impatto ambientale poiché MBE utilizza tecniche e materiali di imballaggio innovative.';
